import React from 'react'
import ReactDOM from 'react-dom'
import ContactCard from './react-contact-card'
import './react-sidebar.css'

function Sidebar(props)
{
    return(
        <div id="siebar">
            <img id="sidebar-avatar" src={props.avatarUrl} alt="Avatar image" />
            <h1 id="sidebar-name">{props.name}</h1>
            <h2 id="sidebar-description">{props.description}</h2>
            <ContactCard 
            phone={props.phone}
            email={props.email}
            facebook={props.facebook}
            instagram={props.instagram}
            youtube={props.youtube}
            />
        </div>
    )
}

export {Sidebar}
